import React, { Component } from "react";
import Header from "./component/header";
import Footer from "./component/footer";
import Main from "./component/main";
import Sidebar from "./component/sidebar";

class App extends Component {
  render() {
    return (
      <div>
        <Header />
        <Sidebar />
        <Main />
        <Footer />
      </div>
    );
  }
}

export default App;
